  false,\n\t\"url\": null,\n\t\"notes\": \"The SIC report is compiled to provide detail
  information regarding the types of business collecting the various taxes connected
  to the retailing of tangible personal property. This report shows the amount of
  each tax type, by a category grouping and totals for each incorporated municipality
  and the unincorporated areas of each county.   Information is for liability periods
  January 2010 thru December 2010 which were collected in February 2010 thru January
  2011.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
